import './index.css';
import { FaUserAlt } from "react-icons/fa";
import { FaHouseUser } from "react-icons/fa";

function HeaderwLogo() {
    return (
        <div className="header">
            <div></div>
            <FaHouseUser />
            SMART HOME FOR YOUR FUTURE
            <FaUserAlt />
        </div>
    );
}
  
export default HeaderwLogo;
